import React, { useEffect, useState } from "react";
import axios from "axios";
import MovieRecommendation from '../components/MovieRecommendation';
import '../styles/Home.css';

const categories = [
  { title: "Trending", query: "trending" },
  { title: "Marvel", query: "marvel" },
  { title: "Harry Potter", query: "harry potter" },
  { title: "Star Wars", query: "star wars" },
  { title: "Top Rated", query: "top rated" },
];

const Home = () => {
  const [movieData, setMovieData] = useState({});
  const [recommendations, setRecommendations] = useState([]);
  const [currentRecIndex, setCurrentRecIndex] = useState(0);

  useEffect(() => {
    const fetchData = async () => {
      const newData = {};
      const trendingRes = await axios.get('https://search.imdbot.workers.dev/?q=trending');
      setRecommendations(trendingRes.data.description.slice(0, 5)); // top 5 recs

      for (const category of categories) {
        try {
          const res = await axios.get(`https://search.imdbot.workers.dev/?q=${category.query}`);
          newData[category.title] = res.data.description || [];
        } catch (err) {
          console.error(`Error fetching ${category.title}`, err);
          newData[category.title] = [];
        }
      }
      setMovieData(newData);
    };

    fetchData();
  }, []);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentRecIndex((prev) => (prev + 1) % recommendations.length);
    }, 10000); // every 10 seconds
    return () => clearInterval(interval);
  }, [recommendations]);

  const currentMovie = recommendations[currentRecIndex];

  return (
    <div className="home-container">
<MovieRecommendation />


      {/* Movie Recommendation */}
      {currentMovie && (
        <div className="recommendation-section">
          <div className="recommendation-content">
            <img
              src={currentMovie["#IMG_POSTER"] || "https://via.placeholder.com/200x300"}
              alt={currentMovie["#TITLE"]}
              className="recommendation-image"
            />
            <div className="recommendation-details">
              <h2>{currentMovie["#TITLE"]}</h2>
              <p><strong>Duration:</strong> {currentMovie["#RUNTIME"] || "120 min"}</p>
              <p><strong>Episodes:</strong> {currentMovie["#SEASONS"] || "1"}</p>
              <p><strong>Description:</strong> {currentMovie["#DESCRIPTION"] || "No description available."}</p>
              <div className="recommendation-buttons">
                <button className="btn favorite-btn">❤️ Favorite</button>
                <button className="btn trailer-btn">▶ Watch Trailer</button>
                <button className="btn play-btn">🎬 Play Movie</button>
              </div>
            </div>
          </div>
        </div>
      )}

      {/* Movie Rows */}
      {Object.keys(movieData).map((category) => (
        <div key={category} className="category-row">
          <h2 className="category-title">{category}</h2>
          <div className="movie-row">
            {movieData[category].map((movie, index) => (
              <div key={index} className="movie-card">
                <img
                  src={movie["#IMG_POSTER"] || "https://via.placeholder.com/160x240"}
                  alt={movie["#TITLE"]}
                  className="movie-image"
                />
                <div className="movie-info">
                  <p className="movie-title">{movie["#TITLE"]}</p>
                  <p className="movie-year">{movie["#YEAR"]}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      ))}
    </div>
  );
};

export default Home;
